import React, { Component } from 'react'
import navitem from "./navitem"
class navbar extends Component{
    constructor(props){
        super(props);
        this.state = {
            'NavItemActive': ''
        }
   }
   render(){
       retrun (
           <nav>
               <ul>
                 <navitem iteam="Home" tolike="/"> </navitem>
                 <navitem iteam="about" tolike="/"> </navitem>
               </ul>
               </nav>
       )
   }
}
export default navbar;
